import { dummy } from "./MovieDummy";
import Movie from "./components/Movie";

function App() {
  return (
    <div>
      <div className="app-container">
        {dummy.results.map((item) => {
          return <Movie 
          title={item.title}
          poster_path={item}
          />;
        })}
      </div>
    </div>
  );
}

export default App;
